import React, { Component } from "react";
import "./style.css";
class Cell extends Component {
  state = {
    columns: [9]
  };

  renderGameBoard() {
    return this.state.columns.map(column => {
      <div className="cellView">
        <div className="cell" />
      </div>;
    });
  }

  render() {
    return renderGameBoard();
  }
}
export { Cell };
